import React from 'react';
import { Nav } from "tabler-react";

class Navbar extends React.Component {
    constructor(props){
        super(props)
        this.onClick = this.props.onClick;
    }

    async overview() {
        try {
            let res = await fetch('/dashboard', {
                method: 'get',
                headers: {
                    'Accept': 'application/json',
                    'Content-Type': 'application/json'
                    }
                });
    
            let result = await res.redirected();
            
            if (result && result.success) {
                alert("it worked lol")
            }
    
            else if (result && result.success === false) {
                alert("almost there")   
                alert(result.msg)
            }
        }
        catch(e) {
            alert("noope")   
            console.log(e);
        }
    }

    render() {
        return (
            <Nav
            items={
            <React.Fragment>
            <Nav.Item active to="dashboard" value="Overview" icon="globe" onClick={() => this.overview()}/>
            <Nav.Item value="Wallet" icon="credit-card"/>
            <Nav.Item value="Profile" icon="user" />
            <Nav.Item value="Logout" onClick={() => this.onClick()} icon="log-out"/>
            </React.Fragment>
            }
        />);
    }
}

export default Navbar;
